import React from 'react';
import { MailOutlined, SettingOutlined, FileTextOutlined, CalendarOutlined, FileAddOutlined } from '@ant-design/icons';
import Draw from '../common/Draw';
import LoginData from '../services/logindata';

const items = [
  {
    label: "Görevler",
    key: 'task',
    icon: <FileTextOutlined />
  },
  {
    label: "Görev Ekle",
    key: 'task2',
    icon: <FileAddOutlined />
  },
  {
    label: "Takvim",
    key: 'calendar',
    icon: <CalendarOutlined />
  },
  {
    label: 'Mail',
    key: 'mail',
    icon: <MailOutlined />,
  },
  {
    label: 'Profil Düzenle',
    key: 'setting:1',
    icon: <SettingOutlined />,
  }
];

const Home = () => {
  const { loggedInUser } = LoginData(); // LoginData'dan loggedInUser'ı alıyoruz

  return (
    <>
      <Draw loggedInUser={loggedInUser} itemsList={items} />
      <div style={{ marginLeft: "20px" }}>
        <h2>Home Page</h2>
        <p>Welcome to the Home Page!</p>
      </div>
      <TaskData />
    </>
  );
};

export default Home;
